        .then(res => res.json());

    console.log(response);

    let num = parseInt(response.num);

    buttonStore.dispatch({
        type: sentType,
        payload: {
            url: response.link,
            month: response.month,
            num: num,
            year: response.year,
            news: response.news,
            safe_title: response.safe_title,
            transcript: response.transcript,
            alt: response.alt,
            img: response.img,
            title: response.title,
            day: response.day
